document.getElementById("addPartButton").addEventListener("click", () => {
  const tableBody = document.querySelector("#partsTable tbody");

  // Criação da nova linha
  const row = document.createElement("tr");

  // Coluna para a quantidade
  const qtyCell = document.createElement("td");
  const qtyInput = document.createElement("input");
  qtyInput.type = "number";
  qtyInput.placeholder = "Quantidade";
  qtyInput.value = 1;  // Valor padrão
  qtyInput.min = 1;  // Valor mínimo
  qtyInput.required = true;
  qtyInput.addEventListener("input", updateTotal); // Atualiza o total quando alterado
  qtyCell.appendChild(qtyInput);

  // Coluna para a peça
  const partCell = document.createElement("td");
  const partInput = document.createElement("input");
  partInput.type = "text";
  partInput.placeholder = "Peça";
  partInput.required = true;
  partCell.appendChild(partInput);

  // Coluna para o valor da peça
  const valueCell = document.createElement("td");
  const valueInput = document.createElement("input");
  valueInput.type = "number";
  valueInput.placeholder = "Valor (R$)";
  valueInput.step = "1";
  valueInput.value = 100;
  valueInput.required = true;
  valueInput.addEventListener("input", updateTotal); // Atualiza o total quando alterado
  valueCell.appendChild(valueInput);

  // Coluna para a ação (botão de remover)
  const actionCell = document.createElement("td");
  const removeButton = document.createElement("button");
  removeButton.textContent = "Remover";
  removeButton.addEventListener("click", () => {
      row.remove();
      updateTotal();
  });
  actionCell.appendChild(removeButton);

  // Adiciona a linha à tabela
  row.appendChild(qtyCell);
  row.appendChild(partCell);
  row.appendChild(valueCell);
  row.appendChild(actionCell);
  tableBody.appendChild(row);

  // Atualiza o total após adicionar a peça
  updateTotal();
});

// Função para atualizar o valor total das peças
function updateTotal() {
  const rows = document.querySelectorAll("#partsTable tbody tr");
  let total = 0;

  rows.forEach(row => {
      const qty = parseFloat(row.querySelector("input[type='number']").value) || 0;
      const value = parseFloat(row.querySelectorAll("input[type='number']")[1].value) || 0;
      total += qty * value;
  });

  // Atualiza o campo de total das peças
  document.getElementById("totalPart").value = total.toFixed(2);
}

document.getElementById("generatePDF").addEventListener("click", async () => {
  const { jsPDF } = window.jspdf;
  const pdf = new jsPDF();

  // Capturar os valores dos campos
  const clientName = document.getElementById("clientName").value;
  const vehicle = document.getElementById("vehicle").value;
  const year = document.getElementById("year").value;
  const labor = document.getElementById("labor").value;
  const totalPart = parseFloat(document.getElementById("totalPart").value) || 0;
  const totalMDO = parseFloat(document.getElementById("totalMDO").value) || 0;

  // Valor total formatado
  const valorTotal = (totalPart + totalMDO).toLocaleString("pt-BR", { style: "currency", currency: "BRL" });
  const ValorMDO = totalMDO.toLocaleString("pt-BR", { style: "currency", currency: "BRL" })

  // LOGO (imagem Base64)
  const logoBase64 = "data:image/png;base64,"; 

  // Adiciona o logo ao topo do PDF
  pdf.addImage(logoBase64, "PNG", 80, 10, 50, 20); // (imagem, tipo, X, Y, largura, altura)

  // Configuração inicial do PDF
  pdf.setFont("helvetica", "bold");

  // Título Principal
  pdf.setFontSize(18);
  pdf.text("RELATÓRIO DE SERVIÇO", 105, 40, { align: "center" });

  pdf.setFontSize(12);
  pdf.setFont("helvetica", "normal");

  // Bordas Laterais
  pdf.setDrawColor(0); // Preto
  pdf.rect(10, 10, 190, 277); // Margem externa (X, Y, largura, altura)

  // Seção: Dados do Cliente (Centralizado)
  pdf.setFontSize(14);
  pdf.setFont("helvetica", "normal");
  pdf.text("DADOS DO CLIENTE", 105, 52, { align: "center" });
  pdf.line(10, 44, 200, 44);

  pdf.setFontSize(12);
  pdf.setFont("helvetica", "normal");
  pdf.text(`Nome: ${clientName}`, 15, 60);
  pdf.text(`Veículo: ${vehicle} | ANO: ${year}`, 15, 70);

  // Seção: Peças Utilizadas (Centralizado)
  pdf.setFontSize(14);
  pdf.setFont("helvetica", "normal");
  pdf.text("PEÇAS UTILIZADAS", 105, 85, { align: "center" });
  pdf.line(10, 90, 200, 90);

  // Cabeçalho da Tabela
  let yPosition = 95;
  pdf.setFontSize(12);
  pdf.text("QTDE", 15, yPosition);
  pdf.text("PEÇA", 65, yPosition);
  pdf.text("VALOR", 120, yPosition);
  pdf.line(10, yPosition + 2, 200, yPosition + 2); // Linha de separação

  pdf.setFont("helvetica", "bold");

  // Listagem das Peças
  const tableBody = document.querySelector("#partsTable tbody");
  tableBody.querySelectorAll("tr").forEach(row => {
      const qty = row.querySelector("input[type='number']").value;
      const part = row.querySelector("input[type='text']").value;
      const value = row.querySelectorAll("input[type='number']")[1].value;
      yPosition += 8;
      pdf.text(qty, 20, yPosition);
      pdf.text(part, 50, yPosition);
      pdf.text(value, 125, yPosition);
  });

  // Seção: Observações (Centralizado)
  yPosition += 15;
  pdf.setFont("helvetica", "italic");
  pdf.setFontSize(14);
  pdf.text("OBSERVAÇÕES", 105, yPosition, { align: "center" });
  pdf.line(10, yPosition + 2, 200, yPosition + 2);

  yPosition += 8;
  pdf.setFontSize(12);
  pdf.setFont("helvetica", "italic");

  // Quebra de linha automática para observações
  const maxWidth = 170; // Largura máxima antes de quebrar a linha
  const observacoes = pdf.splitTextToSize(labor, maxWidth);
  pdf.text(observacoes, 15, yPosition);

  // Ajusta a posição após as observações
  yPosition += observacoes.length * 6 + 10;
  pdf.line(10, yPosition - 5, 200, yPosition - 5);
  pdf.line(10, yPosition + 3, 200, yPosition + 3);

  // Destacar o Valor MDO
  pdf.setFont("helvetica", "normal");
  pdf.setFontSize(12);
  pdf.text(`VALOR DA MÃO DE OBRA: ${ValorMDO}`, 15, yPosition);
  yPosition += 8;
  pdf.line(10, yPosition + 7, 200, yPosition + 7);

  // Destacar o Valor Total
  pdf.setFont("helvetica", "bold");
  pdf.setFontSize(14);
  pdf.text(`VALOR TOTAL: ${valorTotal}`, 105, yPosition+5, { align: "center" });

  // Rodapé
  pdf.setFontSize(10);
  pdf.setFont("helvetica", "italic");
  pdf.text("Gutierres - Oficina Mecânica", 105, 285, { align: "center" });

  pdf.save(clientName + "." + vehicle + "." + year + ".pdf");
});
